import React from "react";
import "./style.css";

function EmployeeTable() {
  return (
    <table>
      <thread>
        <tr>
          <th>Image</th>
          <th>Name</th>
          <th>Phone</th>
          <th>Email</th>
          <th>DOB</th>
        </tr>
        {employees.map }
      </thread>
    </table>
  );
}

export default EmployeeTable;
